import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Dashboard() {
  const [restaurants, setRestaurants] = useState([]);

  useEffect(() => {
    const fetchRestaurants = async () => {
      try {
        const response = await axios.get('/api/restaurant');
        setRestaurants(response.data);
      } catch (error) {
        console.error('Error fetching restaurants:', error);
      }
    };

    fetchRestaurants();
  }, []);

  // Calculate restaurant types distribution
  const restaurantTypesDistribution = restaurants.reduce((acc, restaurant) => {
    acc[restaurant.cuisineType] = (acc[restaurant.cuisineType] || 0) + 1;
    return acc;
  }, {});

  return (
    <div>
      <h2>Dashboard</h2>
      <h3>Insights</h3>
      <div>
        <h4>Restaurant Types Distribution</h4>
        <ul>
          {Object.entries(restaurantTypesDistribution).map(([type, count]) => (
            <li key={type}>{type}: {count}</li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default Dashboard;
